import React, { useState, useMemo, useCallback } from "react";
import Dashboard from "./components/Dashboard/Dashboard";
import useGetFilghts from "../src/hooks/useGetFilghts";

function App() {
    const { data, error, loading } = useGetFilghts();

    console.log(data, error, loading);


    if(loading)
        return(<div>IsLoading</div>)


    return (
    <div className="App">
        <Dashboard flights={data}/>
    </div>);
}

export default App;
